generated.css:
.buttonContainer {
    width: 33.33%;
    height: 100%;
    background-color: rgba(0, 0, 0, 0);
}
.btn {
    width: 100%;
    height: 100%;
    background-color: rgba(0, 0, 0, 0);
    border: none;
}

.btn:focus {
    outline:0;
}

.btn:hover {
    transform: scale(0.95, 0.95);
}

.btn:active {
    transform: scale(0.85, 0.85);
}

.btn:disabled {
    opacity: 0.6;
    transform: none;
}

.btnLogo {
    color: rgba(255, 255, 255, 0.8);
    text-align: center;

}


@media all and (min-width: 668px) {
    .buttonContainer {
        margin: 0 12px 0 0;
        width: 98px;
        height: 90px;
    }

    .btnLogo{
        font-size: 20px;
    }
}
